description:
Francesco Resta is an Italian dj and producer. Having been the resident Dj at a party called High Qualty House at Cassero in Bologna (as François) he had the chance to support international renowned artists such as Âme, Sasha Funke, Carola Pisaturo, Pastaboys, Deetron, Marco Resmann and others.   Through the years he played at a large numbers of venues both in Italy and abroad like Villa Delle Rose, Peter Pan, Link, Cantiere 21, Villaggio Globale, Disco Volante, Clorophilla, Russian Bar (London) and Duplex Club (Porto). 
As a producer, he worked with labels like DTL, The Flame, Pamflet, Society 3.0, Gasoline and had collaborations with artists like Fideles (Afterlife) and Alessandro Sensini (Cecille).
Recently he started to deeply focus on producing and finding his true expression.  In 2018 he completed professional training at SAE Institute in Milan in 2018, obtaining qualified certification.   Later in June 2018,his EP Agung went out on Progrezo Records and has been included within “Beatport’s Top100 best releases” chart.&#13;
His sound is mainly composed by deep and melodic sonorities with techno contaminations.<br />&#13;
&#13;
